import React from 'react';

import NowWeatherScraper from './NowWeatherScraper';

export default function Search() {

    const handleSubmit = () => {
        return (
            <NowWeatherScraper city={document.querySelector('input').value} />
        )
        // console.log(document.querySelector('input').value);
    }

    return (
        <React.Fragment>
            <input className='input'></input>
            <button type="submit" onClick={() => { <NowWeatherScraper city={document.querySelector('input').value} /> }}>Отправить</button>
        </React.Fragment>
    )
}
